BEGIN;


UPDATE
airports
SET pax=s.pax
FROM
(select city,state,country,sum(pax) pax from airports where lower(name)!='all airports' group by 1,2,3) s
WHERE
(lower(airports.name)='all airports')
AND (airports.city=s.city)
AND (
    CASE WHEN COALESCE(airports.state,'')!='' THEN
(airports.state=COALESCE(s.state,'') AND airports.country=COALESCE(s.country,''))
ELSE
airports.country=COALESCE(s.country,'')
END);

COMMIT;